import React, { Component } from 'react';
import { FaFacebookF, FaLinkedinIn, FaTwitter } from 'react-icons/fa';

let TeamContent = [
	{
		images: 'DomHead',
		title: 'Dominique Qright',
		designation: 'President and Co-Founder',
		socialNetwork: [
			{
				icon: <FaFacebookF />,
				url: '#',
			},
			{
				icon: <FaLinkedinIn />,
				url: '#',
			},
			{
				icon: <FaTwitter />,
				url: '#',
			},
		],
	},
	{
		images: 'TJHead',
		title: 'Sean Sutton',
		designation: 'CTO and Mobile Developer',
		socialNetwork: [
			{
				icon: <FaFacebookF />,
				url: '#',
			},
			{
				icon: <FaLinkedinIn />,
				url: '#',
			},
		],
	},
	{
		images: 'ChrisHead',
		title: 'Christopher Simmons',
		designation: 'COO and Co-Founder',
		socialNetwork: [
			{
				icon: <FaFacebookF />,
				url: '#',
			},
			{
				icon: <FaLinkedinIn />,
				url: '#',
			},
			{
				icon: <FaTwitter />,
				url: '#',
			},
		],
	},
	{
		images: 'DomHead',
		title: 'Jone Due',
		designation: 'Sr. Web Developer',
		socialNetwork: [
			{
				icon: <FaFacebookF />,
				url: '#',
			},
			{
				icon: <FaLinkedinIn />,
				url: '#',
			},
			{
				icon: <FaTwitter />,
				url: '#',
			},
		],
	},
	{
		images: 'TJHead',
		title: 'Fatima Asrafi',
		designation: 'Front-end Engineer',
		socialNetwork: [
			{
				icon: <FaFacebookF />,
				url: '#',
			},
			{
				icon: <FaLinkedinIn />,
				url: '#',
			},
		],
	},
	{
		images: 'ChrisHead',
		title: 'Al-Amin Bali',
		designation: 'Sr. Graphic Designer',
		socialNetwork: [
			{
				icon: <FaFacebookF />,
				url: '#',
			},
			{
				icon: <FaLinkedinIn />,
				url: '#',
			},
			{
				icon: <FaTwitter />,
				url: '#',
			},
		],
	},
];

class Team extends Component {
	render() {
		return (
			<React.Fragment>
				{TeamContent.map((value, i) => (
					<div className='col-lg-4 col-md-6 col-sm-6 col-12' key={i}>
						<div className='team'>
							<div className='thumbnail'>
								<img
									src={`/assets/images/head-shots/${value.images}.png`}
									alt='Head Shot Images'
								/>
							</div>
							<div className='content'>
								<h4 className='title'>{value.title}</h4>
								<p className='designation'>{value.designation}</p>
							</div>
							<ul className='social-icon'>
								{value.socialNetwork.map((social, index) => (
									<li key={index}>
										<a href={`${social.url}`}>{social.icon}</a>
									</li>
								))}
							</ul>
						</div>
					</div>
				))}
			</React.Fragment>
		);
	}
}
export default Team;
